import { createStore } from 'redux'

function todos(state = {}, action) {
    switch (action.type) {
        case 'UPDATE_STATE':
            return action.state
            return state
        case 'CHANGE_LIST':
            return {
                ...state,
                CurrentList: action.text
            }
        default:
            return state
    }
}
let store = createStore(todos, {
    ToDoObject:{
        "ONE": ["HIYA", "HELLLOOOO"],
        "TWO": ["BYEYA", "GOODBYEE"]
    },
    ToDoList:["ONE", "TWO"],
    CurrentList: "TWO"
})



export default store
